Ingredients: 
1. 10 ounces of whatever pasta you like. 
2. 3 Tbsp olive oil
3. 4 cloves garlic minced 
4. 4 Tbsp flour 
5. 1 1/2 cups unsweetened almond milk 
6. Salt and pepper
7. 1/4 cup vegan Parmesan cheese. I used follow your heart 😋
8. 6 Tbsp nutritional yeast 
9. Teaspoon garlic powder 
10. Optional** I added some slap ya mama seasoning because it’s good on everything 
11. Optional** field roast Italian sausages
12. Optional ** frozen peas or whatever veggies you want to add
Instructions:
1. Boil pasta in large pot with salted water
2. While pasta is cooking, start your roux. Heat skillet on medium heat, add olive oil and garlic stirring so it doesn’t burn.
3. Reduce the heat a little and add your flour and quickly whisk it up so it makes sort of a paste. Cook for about a minute and then start adding almond milk SLOWLY. Add about 1/4 cup at a time, whisking constantly. Cook for about 2 minutes.
4. Transfer to a blender and add salt and pepper, vegan parm, nutritional yeast, garlic powder and whatever other seasonings you want and blend until creamy and smooth. Obviously at this point adjust seasonings and cheese. If you like it cheesy, add more!
5. Cook your sausage in the skillet and then pour the sauce back in with the sausage. Add frozen peas and cook on low until sauce is thick. 
6. Add the pasta and mix it all together! Top it with more cheese and some red pepper flakes and enjoy! #vegan #alfredo #veganrecipes #veganfood #veganlife #pasta #plantbased #plantbaseddiet #plantbasedfood #govegan #crueltyfree #vegansofig #veganshare #poweredbyplants #veganfoodshare #veganism #vegano #veganismo #vegandinner #veganfoodie #veganeats #vegancommunity";}i:147;a:1:{s:14:"comments_count";i:3;}i:148;a:1:{s:11:"likes_count";i:31;}i:149;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEvN1YdJm3I";}i:150;a:1:{s:5:"image";s:250:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/s1080x1080/118728322_3282416498545706_5035826858839078578_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=102&_nc_ohc=Dzya4NDP7MwAX-k3s2k&oh=489205ebbe555147a5e9f779943d80b3&oe=5F7D02BC";}i:151;a:1:{s:4:"type";s:5:"image";}i:152;a:1:{s:8:"owner_id";i:28581000640;}i:153;a:1:{s:14:"owner_username";s:0:"";}i:154;a:1:{s:14:"owner_fullname";s:0:"";}i:155;a:1:{s:9:"owner_pic";s:0:"";}i:156;a:1:{s:2:"id";s:19:"2391188983696374670";}i:157;a:1:{s:10:"short_code";s:11:"CEvNbYsDLuO";}i:158;a:1:{s:12:"created_time";i:1599271961;}i:159;a:1:{s:7:"caption";s:67:"JALEA DE TOFU 🌿 Link en mi biografía para la receta @veggienoob";}i:160;a:1:{s:14:"comments_count";i:1;}i:161;a:1:{s:11:"likes_count";i:87;}i:162;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEvNbYsDLuO";}i:163;a:1:{s:5:"image";s:249:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/p1080x1080/118746507_620280348687749_3642906428267487344_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=105&_nc_ohc=1D2mkwNZssAAX-CotOC&oh=e8cfc392c79b8060931a7968682b3b63&oe=5F7D776E";}i:164;a:1:{s:4:"type";s:5:"image";}i:165;a:1:{s:8:"owner_id";i:9990265208;}i:166;a:1:{s:14:"owner_username";s:0:"";}i:167;a:1:{s:14:"owner_fullname";s:0:"";}i:168;a:1:{s:9:"owner_pic";s:0:"";}i:169;a:1:{s:2:"id";s:19:"2391188119678215579";}i:170;a:1:{s:10:"short_code";s:11:"CEvNO0AjeWb";}i:171;a:1:{s:12:"created_time";i:1599271858;}i:172;a:1:{